import "./ThreeGrid.css";

export default function ThreeGrid() {
	return (
		<div className="grid-container">
			<div className="big-left-grid"></div>
			<div className="top-right-grid"></div>
			<div className="bottom-right-grid"></div>
		</div>
	);
}
